"const axios = require('axios');
const FormData = require('form-data');

/**
* Remove Background Image
* Created at 03-06-2024
* Created by @rippanteq7 (anjay nge-wm)
*/

const api = axios.create({ baseURL: 'https://api4g.iloveimg.com' })
const getTaskId = async () => {
const { data: html } = await axios.get('https://www.iloveimg.com/id/hapus-latar-belakang')
api.defaults.headers.post['authorization'] = `Bearer ${html.match(/ey[a-zA-Z0-9?%-_/]+/g)[1]}`
return html.match(/taskId = '(\w+)/)[1]
}

const uploadImageToServer = async (imageBuffer) => {
const taskId = await getTaskId()

const fileName = Math.random().toString(36).slice(2) + '.jpg'
const form = new FormData()
form.append('name', fileName)
form.append('chunk', '0')
form.append('chunks', '1')
form.append('task', taskId)
form.append('preview', '1')
form.append('pdfinfo', '0')
form.append('pdfforms', '0')
form.append('pdfresetforms', '0')
form.append('v', 'web.0')
form.append('file', imageBuffer, fileName)

const reqUpload = await api.post('/v1/upload', form, { headers: form.getHeaders() })
.catch(e => e.response)
if (reqUpload.status !== 200) throw reqUpload.data || reqUpload.statusText

return { serverFilename: reqUpload.data.server_filename, taskId }
}

const removeBg = async (imageBuffer, responseType = 'arraybuffer') => {
const { serverFilename, taskId } = await uploadImageToServer(imageBuffer)

const form = new FormData()
form.append('task', taskId)
form.append('server_filename', serverFilename)

const reqRmbg = await api.post('/v1/removebackground', form, {
headers: form.getHeaders(), responseType
}).catch(e => e.response)
const type = reqRmbg.headers['content-type']
if (reqRmbg.status !== 200 || !/image/.test(type))
throw JSON.parse(reqRmbg.data?.toString() || '{"error":{"message":"An error occurred"}}')

return reqRmbg.data
}

exports.run = {
usage: ['removebg'],
hidden: ['rbg'],
use: 'reply photo',
category: 'ai',
async: async (m, { func, mecha, quoted }) => {
if (/image\/(jpe?g|png)/.test(quoted.mime)) {
mecha.sendReact(m.chat, '🕒', m.key)
try {
const buffer = await quoted.download()
const result = await removeBg(buffer, 'arraybuffer')
await mecha.sendMessage(m.chat, {
image: result,
caption: global.mess.ok
}, {quoted: m, ephemeralExpiration: m.expiration})
} catch (e) {
m.reply(String(e))
}
} else m.reply(`Kirim/Reply gambar dengan caption ${m.cmd}`)
},
premium: true,
limit: 3
}"

"const axios = require('axios');
const FormData = require('form-data');
const { fromBuffer } = require('file-type');

exports.run = {
usage: ['tourl', 'tourl2'],
use: 'reply photo',
category: 'convert',
async: async (m, { func, mecha, quoted }) => {
switch (m.command) {
case 'tourl':{
if (/image|video|audio|webp/.test(quoted.mime)) {
mecha.sendReact(m.chat, '🕒', m.key)
let buffer = await quoted.download()
let catbox = await func.catbox(buffer)
if (!catbox.status) return m.reply(catbox.message)
mecha.reply(m.chat, (catbox.url || ''), m, {
expiration: m.expiration
})
} else m.reply('Input media dengan benar!')
}
break;
case 'tourl2':{
if (/image|video|audio|webp/.test(quoted.mime)) {
mecha.sendReact(m.chat, '🕒', m.key)
let buffer = await quoted.download()
const { ext, mime } = (await fromBuffer(buffer)) || {};
const form = new FormData();
form.append("file", buffer, {
filename: `tmp.${ext}`,
contentType: mime
});
try {
const { data } = await axios.post("https://tmpfiles.org/api/v1/upload", form, {
headers: form.getHeaders()
});
const match = /https?:\/\/tmpfiles.org\/(.*)/.exec(data.data.url);
await mecha.reply(m.chat, `https://tmpfiles.org/dl/${match[1]}`, m, {
expiration: m.expiration
});
} catch (error) {
await mecha.reply(m.chat, error.message, m, {
expiration: m.expiration
});
}
} else m.reply('Input media dengan benar!')
}
break
}
},
limit: true
}"

"const toMs = require('ms')
const {
    getBinaryNodeChild
} = require('@whiskeysockets/baileys');

exports.run = {
    usage: ['addsewa'],
    use: 'link group + waktu',
    category: 'owner',
    async: async (m, {
        func,
        mecha,
        errorMessage
    }) => {
        if (m.isPc) {
            let [url, time] = m.args;
            if (!(url && time)) return m.reply(func.example(m.cmd, 'https://chat.whatsapp.com/codeInvite 15d'))
            try {
                let link = /chat.whatsapp.com\/([0-9A-Za-z]{20,24})/i
                let [_, code] = url.match(link) || []
                if (!code) return m.reply('No invite url detected.');
                let response = await mecha.query({
                    tag: 'iq',
                    attrs: {
                        type: 'get',
                        xmlns: 'w:g2',
                        to: '@g.us'
                    },
                    content: [{
                        tag: 'invite',
                        attrs: {
                            code: code
                        }
                    }]
                })
                let group = getBinaryNodeChild(response, 'group');
                let groupId = group?.attrs?.id.includes('@') ? group?.attrs?.id : group?.attrs?.id + '@g.us';
                let groupData = global.db.groups[groupId];
                if (!groupData) {
                    global.db.groups[groupId] = {
                        jid: groupId,
                        sewa: {
                            status: false,
                            notice: false,
                            expired: 0
                        }
                    }
                } else {
                    if (!groupData.hasOwnProperty('jid')) groupData.jid = groupId;
                    if (!groupData.hasOwnProperty('sewa')) groupData.sewa = {
                        status: false,
                        notice: false,
                        expired: 0
                    }
                }
                if (groupData.sewa.hasOwnProperty('status') && groupData.sewa.status) return m.reply('Grup tersebut sudah ada di list sewa!')
                groupData.sewa.expired = time ? Date.now() + toMs(time) : Date.now() + 2592000000;
                groupData.sewa.status = true;
                groupData.sewa.notice = true;
                m.reply(`Successfully added rent to this group for ${time}`)
            } catch (error) {
                let err = String(error)
                if (err.includes('not-authorized')) return m.reply('Masukkan bot kedalam grup tersebut terlebih dahulu.')
                return errorMessage(error)
            }
        } else if (m.isGc) {
            if (!m.text) return m.reply(`Masukkan durasi sewa!\nContoh: ${m.cmd} 15d`)
            let groupData = global.db.groups[m.chat];
            if (groupData.sewa.hasOwnProperty('status') && groupData.sewa.status) return m.reply('Grup ini sudah ada di list sewa!')
            groupData.sewa.expired = m.args[0] ? Date.now() + toMs(m.args[0]) : Date.now() + 2592000000;
            groupData.sewa.status = true;
            groupData.sewa.notice = true;
            m.reply(`Successfully added rent to this group for ${m.args[0]}`)
        }
    },
    owner: true
}"

"const axios = require('axios');
const cheerio = require('cheerio');
const path = require('path');
const fs = require('fs');

const svweb = async (link, responseType = 1, convertOption = '--convert') => {
    try {
        const {
            data
        } = await axios.post('https://tella.mockso-cloud.com/screenshot/video', {
            url: link
        }, {
            headers: {
                'Content-Type': 'application/json',
                'User-Agent': 'Postify/1.0.0'
            },
            responseType: 'arraybuffer'
        });

        const result = responseType === 1 ? Buffer.from(data) : Buffer.from(data).toString('base64');
        const domainName = new URL(link).hostname.replace('www.', '').split('.')[0];

        if (result.length < 1024) {
            throw new Error('Website tersebut tidak dapat terhubung..');
        }

        if (convertOption === '--convert') {
            const fileName = `${domainName}_video.mp4`;
            const filePath = path.join(process.cwd(), 'downloads', fileName);
            await fs.promises.mkdir(path.dirname(filePath), {
                recursive: true
            });
            await fs.promises.writeFile(filePath, result, responseType === 1 ? null : 'base64');
            console.log(`Video telah disimpan ke ${filePath}`);
            return {
                filePath,
                data: result
            };
        }

        if (convertOption === '--unconvert') {
            return {
                type: responseType === 1 ? 'buffer' : 'base64',
                data: result
            };
        }

        throw new Error('❌ Opsi konversinya kagak valid. pake --convert atau --unconvert yakk...');
    } catch (error) {
        console.error(error.message);
        throw error;
    }
};

exports.run = {
    usage: ['svweb', 'ssweb'],
    use: 'url',
    category: 'tools',
    async: async (m, {
        func,
        mecha
    }) => {
        if (!m.text) return m.reply('Masukkan URL nya.')
        if (!func.isUrl(m.args[0])) return m.reply(global.mess.error.url)
        mecha.sendReact(m.chat, '🕒', m.key)
        try {
            let result = await svweb(m.text, 1, '--unconvert');
            mecha.sendMedia(m.chat, result.data, m, {
                expiration: m.expiration,
                caption: global.mess.ok
            });
        } catch (error) {
            return m.reply(error.toString())
        }
    },
    limit: 3
}"

